pragma solidity ^0.5.0;
import "./Whitelist.sol";
import "./interfaces/IERC.sol";
import "./modules/Admin.sol";
/*
    Define:
    pair (TokenA, TokenB) != (TokenB, TokenA)
    weiX = wei of TokenX
    price(TokenA, TokenB) = weiB * ZOOM  / weiA
    buy/sell tokenA
    buy: deposit TokenB
    sell: deposit TokenA
*/

contract Structs {

    struct Order {
        bytes32 book;
        address owner;
        uint depositedAmount;
        uint price;
        bytes32 next;
        bytes32 prev;
        uint nonce;
    }

    struct OrderList {
        bytes32 highestId;
        bytes32 lowestId;
    }

    struct Book {
        address[2] tokens;
        bool orderType;
        bytes32 pairedBook;
        bytes32 highestId;
        bytes32 lowestId;
    }
}

contract Constants {
    uint constant MAX_UINT128 = uint128(0) - 1;
    uint constant MAX_UINT = uint(MAX_UINT128);

    uint constant ZOOM =  10**18;

    bool constant BUY = true;
    bool constant SELL = false;

    address constant ZERO_ADDRESS = address(0x0);

    uint constant LOOP_LIMIT = 100;

    uint constant CASHBACK = 0.02 ether;
}

contract Events {
    event CreatePair(
        address _tokenA,
        address _tokenB,
        bytes32 _sellBookId,
        bytes32 _buyBookId,
        uint _createdAt
    );

    event CreateOrder(
        bytes32 indexed _orderId,
        bytes32 indexed _book,
        address indexed _owner,
        uint _price,
        uint _amount,
        uint _createdAt
    );

    event UpdateOrder(
        bytes32 indexed _orderId,
        bytes32 indexed _book,
        address indexed _owner,
        uint _amount,
        uint _createdAt
    );

    event RemoveOrder(
        bytes32 indexed _orderId,
        bytes32 indexed _book,
        address indexed _owner,
        uint _createdAt
    );

    event CancelOrder(
        bytes32 indexed _orderId,
        bytes32 indexed _book,
        address indexed _owner,
        uint _createdAt
    );

    event Matching(
        bytes32 indexed _sellBook,
        bytes32 indexed _buyBook,
        uint _price,
        uint _amount,
        bool _orderType,
        uint _createdAt
    );

    event TokenReceived(
        bytes32 indexed _orderId,
        bytes32 indexed _book,
        address indexed _owner,
        uint _amount
    );

    event ChangeFee(
        address indexed _token,
        uint _newFee,
        uint _createdAt
    );
}

contract Dex is Structs, Constants, Events, Admin {
    modifier validPrice(uint _price) {
        require(_price > 0 && _price < MAX_UINT, "Invalid Price");
        _;
    }

    mapping(bytes32 => Book) public books;
    mapping(bytes32 => bool) public bookCreated;
    mapping(bytes32 => Order) public orders;

    uint public nonce;

    uint public matchingFee = 10; // 0.01% in basis points (parts per 10000)
    mapping(address => uint) public fixedFeeOf;
    // Store all fee based on token address
    mapping (address => uint) public feePool;

    constructor(
        address[] memory _dexAdmins,
        address wDRK,
        address wETH
    )
        payable
        Admin(_dexAdmins)
        public
    {
        fixedFeeOf[wETH] = 0.0001 ether; // 0.0001 ETH
        fixedFeeOf[wDRK] = 10 ether; // 10 DRK

        initBooks([wDRK, wETH]);
    }

    function() external payable {
    }

    function _changeFee(address _token, uint _newFee) private returns (bool) {
        fixedFeeOf[_token] = _newFee;
        emit ChangeFee(_token, _newFee, now);
        return true;
    }

    function changeFee(address token, uint newFee) public onlyAdmin(msg.sender) {
        require(_changeFee(token, newFee),"Failed-to-set-new-fee");
    }

    function initBooks(
        address[2] memory _tokens
    )
        public
    {
        // require(
        //     whitelisted(_tokens[0]) && whitelisted(_tokens[1]),
        //     "Token not listed"
        // );
        bytes32 buyBookId = getBookId(_tokens, BUY);
        bytes32 sellBookId = getBookId(_tokens, SELL);

        if (bookCreated[buyBookId]) {
            return;
        }

        bookCreated[buyBookId] = true;
        bookCreated[sellBookId] = true;

        Book storage buyBook = books[buyBookId];
        Book storage sellBook = books[sellBookId];

        buyBook.tokens = _tokens;
        buyBook.orderType = BUY;
        buyBook.pairedBook = sellBookId;

        sellBook.tokens = _tokens;
        sellBook.orderType = SELL;
        sellBook.pairedBook = buyBookId;

        _initBook(buyBookId);
        _initBook(sellBookId);
        emit CreatePair(
            _tokens[0],
            _tokens[1],
            sellBookId,
            buyBookId,
            now
        );
    }

    function _initBook(
        bytes32 _bookId
    )
        internal
    {
        Book storage book = books[_bookId];
        bytes32 highestId = _createOrderId();
        bytes32 lowestId = _createOrderId();
        book.lowestId = lowestId;
        book.highestId = highestId;

        orders[highestId].book = _bookId;
        orders[highestId].price = MAX_UINT;
        orders[highestId].prev = lowestId;

        orders[lowestId].book = _bookId;
        orders[lowestId].next = highestId;
    }

    function getBookId(
        address[2] memory _tokens,
        bool _orderType
    )
        public
        pure
        returns(bytes32)
    {
        return sha256(abi.encodePacked(_tokens[0], _tokens[1], _orderType));
    }

    function _createOrderId()
        internal
        returns(bytes32)
    {
        nonce++;
        return sha256(abi.encodePacked(nonce));
    }

    function _defaultPointer(
        Book storage _book
    )
        internal
        view
        returns(bytes32)
    {
        if (_book.orderType == BUY) {
            return _book.highestId;
        } else {
            return _book.lowestId;
        }
    }

    function _insert(
        bytes32 _nextId,
        bytes32 _newOrderId
    )
        internal
    {
        bytes32 _prevId = orders[_nextId].prev;
        orders[_nextId].prev = _newOrderId;
        orders[_prevId].next = _newOrderId;
        orders[_newOrderId].prev = _prevId;
        orders[_newOrderId].next = _nextId;
    }

    function _findNextId(
        Book storage _book,
        uint _price,
        bytes32 _pointer
    )
        internal
        view
        returns(bytes32)
    {
        bytes32 pointer = _pointer;
        if (_book.orderType == BUY) {
            while (_price > orders[pointer].price) {
                pointer = orders[pointer].next;
            }
            if (pointer != _pointer) return pointer;
            pointer = orders[pointer].prev;
            while (_price <= orders[pointer].price) {
                pointer = orders[pointer].prev;
            }
            return orders[pointer].next;
        } else {
            while (_price >= orders[pointer].price) {
                pointer = orders[pointer].next;
            }
            if (pointer != _pointer) return pointer;
            pointer = orders[pointer].prev;
            while (_price < orders[pointer].price) {
                pointer = orders[pointer].prev;
            }
            return orders[pointer].next;
        }
    }

    function getBookToken(
        Book storage _book
    )
        internal
        view
        returns(address tokenAddress)
    {
        tokenAddress = _book.orderType == BUY
            ? _book.tokens[1]
            : _book.tokens[0];
    }

    function _leadingOrder(
        Book storage book
    )
        internal
        view
        returns(bytes32)
    {
        if (book.orderType == BUY) {
            return orders[book.highestId].prev;
        } else {
            return orders[book.lowestId].next;
        }
    }

    function _matching(
        address[2] memory _tokens,
        bytes32 _buyOrderId,
        bytes32 _sellOrderId
    )
        internal
        returns(bool)
    {
        Order storage buyOrder = orders[_buyOrderId];
        Order storage sellOrder = orders[_sellOrderId];
        if (buyOrder.price < sellOrder.price) return false;
        address tokenA = _tokens[0];
        address tokenB = _tokens[1];
        // price equal to order created before
        uint price = buyOrder.nonce < sellOrder.nonce ? buyOrder.price : sellOrder.price;
        // (A, B)
        // P = wei B * ZOOM / wei A
        // BA = BB / P
        // BB = buyer deposited
        // SA = seller deposited
        // SB = SA * P
        // SA * P
        uint tmp = sellOrder.depositedAmount * price / ZOOM;
        bool orderType = sellOrder.nonce > buyOrder.nonce ? BUY : SELL;
        // BB / P < SA
        // buyOrder full filled ->  remove
        if (tmp > buyOrder.depositedAmount) {
            // -= BB / P
            // amount send to Buyer = (Buyer.deposit - matchingFee)*Zoom/price
            // ammount send to seller = (Buyer.deposit - matchingFee)
            uint tokenAfeeAmount = buyOrder.depositedAmount * matchingFee / 10000;
            uint tokenAToBuyer = (buyOrder.depositedAmount - tokenAfeeAmount) * ZOOM / price;
            feePool[tokenA] += tokenAfeeAmount;
            sellOrder.depositedAmount -= buyOrder.depositedAmount * ZOOM / price;
            emit UpdateOrder(_sellOrderId, sellOrder.book, sellOrder.owner, sellOrder.depositedAmount, now);
            emit Matching(sellOrder.book, buyOrder.book, price, tokenAToBuyer, orderType, now);
            IERC(tokenA).transfer(buyOrder.owner, tokenAToBuyer);
            emit TokenReceived(_buyOrderId, buyOrder.book, buyOrder.owner, tokenAToBuyer);
            uint tokenBfeeAmount = buyOrder.depositedAmount * matchingFee / 10000;
            uint tokenBToSeller = buyOrder.depositedAmount - tokenBfeeAmount;
            feePool[tokenB] += tokenBfeeAmount;
            IERC(tokenB).transfer(sellOrder.owner, tokenBToSeller);
            emit TokenReceived(_sellOrderId, sellOrder.book, sellOrder.owner, tokenBToSeller);
            _remove(_buyOrderId);
        } else {
        // sellOrder full filled -> remove
            // -= SA * P
            // Charge matching fee of Seller
            uint tokenBfeeAmount = sellOrder.depositedAmount * matchingFee / 10000;
            uint tokenBToSeller = (sellOrder.depositedAmount - tokenBfeeAmount) * price / ZOOM;
            feePool[tokenB] += tokenBfeeAmount;
            buyOrder.depositedAmount -= sellOrder.depositedAmount * price / ZOOM;
            emit UpdateOrder(_buyOrderId, buyOrder.book, buyOrder.owner, buyOrder.depositedAmount, now);
            emit Matching(sellOrder.book, buyOrder.book, price, sellOrder.depositedAmount, orderType, now);
            IERC(tokenB).transfer(sellOrder.owner, tokenBToSeller);
            emit TokenReceived(_sellOrderId, sellOrder.book, sellOrder.owner, tokenBToSeller);
            uint tokenAfeeAmount = sellOrder.depositedAmount * matchingFee / 10000;
            uint tokenAToBuyer = sellOrder.depositedAmount - tokenAfeeAmount;
            feePool[tokenA] += tokenAfeeAmount;
            IERC(tokenA).transfer(buyOrder.owner, tokenAToBuyer);
            emit TokenReceived(_buyOrderId, buyOrder.book, buyOrder.owner, tokenAToBuyer);
            _remove(_sellOrderId);
        }
        return true;
    }

    /*
        use gas used + limit to calculate loop
    */
    function matchingLoop(
        bytes32 _bookId,
        uint _loopLimit
    )
        public
    {
        Book storage book = books[_bookId];
        Book storage pairedBook = books[book.pairedBook];
        uint currentLoop = 0;
        if (book.orderType == BUY) {
            while (currentLoop < _loopLimit) {
                bytes32 leaderOrder = _leadingOrder(book);
                bytes32 pairedLeaderOrder = _leadingOrder(pairedBook);
                bool success = _matching(book.tokens, leaderOrder, pairedLeaderOrder);
                if (!success) return;
                currentLoop++;
            }
        } else {
            while (currentLoop < _loopLimit) {
                bytes32 leaderOrder = _leadingOrder(book);
                bytes32 pairedLeaderOrder = _leadingOrder(pairedBook);
                bool success = _matching(book.tokens, pairedLeaderOrder, leaderOrder);
                if (!success) return;
                currentLoop++;
            }
        }
    }

    function create(
        bytes32 _bookId,
        uint _depositedAmount,
        uint _price,
        bytes32 _pointer
    )
        public
        validPrice(_price)
    {
        address payable _sender = msg.sender;
        require(bookCreated[_bookId], "book not created!");
        Book storage book = books[_bookId];
        address tokenAddress = getBookToken(book);
        // Charge create order fee: totalAmountTransfer = _depositedAmount + fixedFeeOf[tokenAddress]
        IERC(tokenAddress).transferFrom(_sender, address(this), _depositedAmount + fixedFeeOf[tokenAddress]);
        feePool[tokenAddress] += fixedFeeOf[tokenAddress];
        bytes32 pointer = _pointer;
        if (orders[_pointer].book != _bookId) {
            pointer = _defaultPointer(book);
        }
        bytes32 nextId = _findNextId(book, _price, pointer);
        bytes32 newOrderId = _createOrderId();
        Order storage newOrder = orders[newOrderId];

        newOrder.book = _bookId;
        newOrder.owner = _sender;
        newOrder.depositedAmount = _depositedAmount;
        newOrder.price = _price;
        newOrder.nonce = nonce;
        _insert(nextId, newOrderId);
        emit CreateOrder(
            newOrderId,
            _bookId,
            _sender,
            _price,
            _depositedAmount,
            now
        );
        // try to match order after creating
        matchingLoop(_bookId, LOOP_LIMIT);
        _sender.transfer(CASHBACK);
    }

    function create1st(
        address[2] memory _tokens,
        bytes32 _bookId,
        uint _depositedAmount,
        uint _price,
        bytes32 _pointer
    )
        public
    {
        initBooks(_tokens);
        create(
            _bookId,
            _depositedAmount,
            _price,
            _pointer
        );
    }

    function _remove(
        bytes32 _id
    )
        internal
    {
        Order storage order = orders[_id];
        bytes32 prev = order.prev;
        bytes32 next = order.next;
        orders[prev].next = next;
        orders[next].prev = prev;
        emit RemoveOrder(_id, order.book, order.owner, now);
        delete orders[_id];
    }

    function cancel(
        bytes32 _id
    )
        public
    {
        address _sender = msg.sender;
        Order storage order = orders[_id];
        require(_sender == order.owner, "only owner can remove order");
        bytes32 prev = order.prev;
        bytes32 next = order.next;
        orders[prev].next = next;
        orders[next].prev = prev;
        uint depositedAmount = order.depositedAmount;
        Book storage book = books[order.book];
        address tokenAddress = getBookToken(book);
        IERC(tokenAddress).transfer(_sender, depositedAmount);
        emit CancelOrder(_id, order.book, order.owner, now);
        delete orders[_id];
    }

    function _adminClaimFee(address _token) internal returns (bool) {
        uint feeBalance = feePool[_token];
        require(IERC(_token).transfer(msg.sender, feeBalance),"Failed-to-transfer-token");
        feePool[_token] = 0;
        return true;
    }

    function adminClaimFee(address token) onlyAdmin(msg.sender) public {
        _adminClaimFee(token);
    }

    /*
        Public Functions
    */

    function loadOrderbook(
        bytes32 _bookId,
        uint _total
    )
        public
        view
        returns(uint, bytes32[] memory, uint[] memory, uint[] memory)
    {
        Book memory book = books[_bookId];
        Order memory order;
        bytes32 cursor;
        uint total = 0;
        bytes32[] memory orderIds = new bytes32[](_total);
        uint[] memory prices = new uint[](_total);
        uint[] memory amounts = new uint[](_total);
        if (book.orderType == SELL) {
            cursor = book.lowestId;
            order = orders[cursor];
            while ((total < _total) && (order.next != book.highestId)) {
                cursor = order.next;
                order = orders[cursor];
                orderIds[total] = cursor;
                prices[total] = order.price;
                amounts[total] = order.depositedAmount;
                total++;
            }
        } else {
            cursor = book.highestId;
            order = orders[cursor];
            while ((total < _total) && (order.prev != book.lowestId)) {
                cursor = order.prev;
                order = orders[cursor];
                orderIds[total] = cursor;
                prices[total] = order.price;
                amounts[total] = order.depositedAmount;
                total++;
            }
        }
        return (total, orderIds, prices, amounts);
    }
}
